import React from 'react';
import { StyleSheet } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">

    <ul className="topNav">
      <li className="item"><a className="icon" href="https://www.github.com/danielkioko"><img src="./images/002-github" alt=""/></a></li>
      <li className="item"><a className="icon" href="https://www.instagram.com/itsdanielkioko"><img src="./images/001-instagram.png" alt=""/></a></li>
      <li className="item"><a className="icon" href="#"><img src="./images/003-mail.png" alt=""/></a></li>
    </ul>

    <div class="wrapper">
      <header>
          <h1>DANIEL KIOKO</h1>
          <p>Software Developer</p>
      </header>
    </div>

      <footer>
          <p>ⓒ 2020 · ItsDanielKioko</p>
      </footer>

    </div>
  );
}

export default App;
